def minPath(grid, k):
    from heapq import heappush, heappop

    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]

    def neighbors(r, c):
        for dr, dc in directions:
            nr, nc = r + dr, c + dc
            if 0 <= nr < N and 0 <= nc < N:
                yield nr, nc

    def bfs():
        pq = [(grid[i][j], i, j, [grid[i][j]]) for i in range(N) for j in range(N)]
        while pq:
            cost, r, c, path = heappop(pq)
            if len(path) == k:
                return path
            for nr, nc in neighbors(r, c):
                if len(path) < k:
                    new_path = path + [grid[nr][nc]]
                    heappush(pq, (cost, nr, nc, new_path))

    return bfs()

def tri(n):
    """Return the first n + 1 numbers of the Tribonacci sequence."""
    # Correcting the initial conditions based on the function description
    sequence = [3]
    if n == 0:
        return sequence
    for i in range(1, n + 1):
        if i % 2 == 0:
            sequence.append(1 + i / 2)
        else:
            if i == 1:
                # Handling the case for tri(1) based on the given recurrence
                sequence.append(sequence[-1])
            elif i == 2:
                # Handling the case for tri(2) based on the given recurrence
                sequence.append(sequence[-1] + sequence[-2])
            else:
                # Adjusting the calculation for tri(n) when n > 2 and odd
                # Need to ensure we don't try to access sequence[i+1] as it doesn't exist yet
                # Instead, calculate it based on the condition for even numbers
                next_val = 1 + (i + 1) / 2
                sequence.append(sequence[-1] + sequence[-2] + next_val)
    return sequence

